import React from 'react';

const Skills = () => {
  const skills = [
    { name: 'Python', icon: 'ðŸ', category: 'Programming', level: 90 },
    { name: 'C', icon: 'âš™ï¸', category: 'Programming', level: 85 },
    { name: 'C++', icon: 'ðŸ”§', category: 'Programming', level: 80 },
    { name: 'JavaScript', icon: 'âš¡', category: 'Web Development', level: 95 },
    { name: 'Java', icon: 'â˜•', category: 'Programming', level: 85 },
    { name: 'Flutter', icon: 'ðŸ“±', category: 'Mobile Development', level: 75 },
    { name: 'SQL', icon: 'ðŸ—„ï¸', category: 'Database', level: 90 },
    { name: 'MongoDB', icon: 'ðŸƒ', category: 'Database', level: 80 },
    { name: 'React.js', icon: 'âš›ï¸', category: 'Frontend', level: 92 },
    { name: 'Node.js', icon: 'ðŸŸ¢', category: 'Backend', level: 88 },
    { name: 'AI', icon: 'ðŸ¤–', category: 'Artificial Intelligence', level: 70 }
  ];

  const getCategoryColor = (category) => {
    const colors = {
      'Programming': 'from-blue-400 to-blue-600',
      'Web Development': 'from-yellow-400 to-orange-500',
      'Mobile Development': 'from-purple-400 to-purple-600',
      'Database': 'from-green-400 to-green-600',
      'Frontend': 'from-cyan-400 to-cyan-600',
      'Backend': 'from-emerald-400 to-emerald-600',
      'Artificial Intelligence': 'from-pink-400 to-pink-600'
    };
    return colors[category] || 'from-gray-400 to-gray-600';
  };

  return (
    <section id="skills" className="py-16 sm:py-20 lg:py-24 bg-white">
      <div className="container-max section-padding">
        <div className="max-w-7xl mx-auto">
          {/* Section Header */}
          <div className="text-center mb-16">
            <h2 className="text-3xl sm:text-4xl lg:text-5xl font-bold text-nature-white-900 mb-6">
              My <span className="text-gradient">Skills</span>
            </h2>
            <p className="text-lg text-nature-white-600 max-w-3xl mx-auto">
              Technologies and tools I use to create amazing digital experiences
            </p>
            <div className="w-24 h-1 bg-gradient-to-r from-nature-green-400 to-nature-green-600 mx-auto rounded-full mt-6"></div>
          </div>

          {/* Skills Grid */}
          <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 xl:grid-cols-5 gap-6">
            {skills.map((skill, index) => (
              <div 
                key={index}
                className="group bg-white rounded-2xl shadow-lg hover:shadow-2xl transition-all duration-500 hover:-translate-y-3 p-6 text-center border border-nature-green-100 relative overflow-hidden"
                style={{ animationDelay: `${index * 0.1}s` }}
              >
                {/* Hover Background Effect */}
                <div className="absolute inset-0 bg-gradient-to-br from-nature-green-50 to-nature-green-100 opacity-0 group-hover:opacity-100 transition-opacity duration-500"></div>
                
                {/* Content */}
                <div className="relative z-10">
                  {/* Icon */}
                  <div className="text-5xl mb-4 group-hover:scale-110 transition-transform duration-300">
                    {skill.icon}
                  </div>
                  
                  {/* Skill Name */}
                  <h3 className="text-lg font-bold text-nature-white-900 mb-2 group-hover:text-nature-green-600 transition-colors duration-300">
                    {skill.name}
                  </h3>
                  
                  {/* Category */}
                  <p className="text-sm text-nature-white-500 mb-4 group-hover:text-nature-green-700 transition-colors duration-300">
                    {skill.category}
                  </p>
                  
                  {/* Progress Bar */}
                  <div className="w-full bg-nature-green-100 rounded-full h-2 mb-2">
                    <div 
                      className={`bg-gradient-to-r ${getCategoryColor(skill.category)} h-2 rounded-full transition-all duration-1000 ease-out group-hover:scale-105`}
                      style={{ width: `${skill.level}%` }}
                    ></div>
                  </div>
                  
                  {/* Level Percentage */}
                  <div className="text-sm font-semibold text-nature-green-600 group-hover:text-nature-green-700 transition-colors duration-300">
                    {skill.level}%
                  </div>
                </div>

                {/* Hover Border Effect */}
                <div className="absolute inset-0 rounded-2xl border-2 border-nature-green-200 opacity-0 group-hover:opacity-100 transition-opacity duration-300"></div>
              </div>
            ))}
          </div>

          {/* Skills Categories Overview */}
          <div className="mt-16">
            <h3 className="text-2xl font-bold text-nature-white-900 text-center mb-8">
              Skills by Category
            </h3>
            <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
              {[
                { category: 'Programming Languages', skills: ['Python', 'C', 'C++', 'JavaScript', 'Java'], color: 'from-blue-400 to-blue-600' },
                { category: 'Web Development', skills: ['React.js', 'Node.js', 'JavaScript'], color: 'from-yellow-400 to-orange-500' },
                { category: 'Mobile Development', skills: ['Flutter', 'React Native'], color: 'from-purple-400 to-purple-600' },
                { category: 'Database Management', skills: ['SQL', 'MongoDB', 'PostgreSQL'], color: 'from-green-400 to-green-600' },
                { category: 'AI & Machine Learning', skills: ['AI', 'Machine Learning', 'Data Science'], color: 'from-pink-400 to-pink-600' },
                { category: 'Tools & Technologies', skills: ['Git', 'Docker', 'AWS', 'VS Code'], color: 'from-gray-400 to-gray-600' }
              ].map((category, index) => (
                <div key={index} className="bg-white rounded-xl shadow-lg hover:shadow-xl transition-all duration-300 hover:-translate-y-2 p-6 border border-nature-green-100">
                  <h4 className="text-lg font-bold text-nature-white-900 mb-4 flex items-center">
                    <div className={`w-3 h-3 rounded-full bg-gradient-to-r ${category.color} mr-3`}></div>
                    {category.category}
                  </h4>
                  <div className="flex flex-wrap gap-2">
                    {category.skills.map((skill, skillIndex) => (
                      <span key={skillIndex} className="px-3 py-1 bg-nature-green-50 text-nature-green-700 rounded-full text-sm font-medium">
                        {skill}
                      </span>
                    ))}
                  </div>
                </div>
              ))}
            </div>
          </div>

          {/* Additional Skills */}
          <div className="mt-16">
            <h3 className="text-2xl font-bold text-nature-white-900 text-center mb-8">
              Soft Skills & Expertise
            </h3>
            <div className="flex flex-wrap justify-center gap-4">
              {[
                'Problem Solving', 'Team Leadership', 'Project Management', 
                'Agile/Scrum', 'Code Review', 'Mentoring', 'Technical Writing',
                'Performance Optimization', 'Security Best Practices', 'Cross-platform Development',
                'UI/UX Design', 'API Development', 'Cloud Computing', 'DevOps'
              ].map((skill, index) => (
                <div key={index} className="px-6 py-3 bg-white rounded-full shadow-md hover:shadow-lg hover:-translate-y-1 transition-all duration-300 border border-nature-green-100 group">
                  <span className="text-nature-white-700 font-medium group-hover:text-nature-green-600 transition-colors duration-300">{skill}</span>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
